Secondary Outcome Measures:
Progression-free Survival, An event for progression-free survival is local, regional, or distant disease progression or death due to any cause. Progression-free survival time is defined as time from randomization to the date of progression/death or last known follow-up (censored). Rates are estimated by the Kaplan-Meier method. The protocol endpoint is the distribution of progression-free survival times, for which the hazard ratio is reported in the statistical analysis results. Five-year rate is reported simply as summary data; it is not the outcome measure., From randomization to last follow-up. Analysis was to occur after 180 deaths were reported. Analysis occurred after 133 deaths were reported. Maximum follow-up at time of analysis was 6.5 years.|Time to Local-regional Failure, Failure for local-regional failure endpoint was defined as local or regional progression, salvage surgery of the primary tumor with tumor present/unknown, salvage neck dissection with tumor present/unknown \> 20 weeks after the end of radiation therapy, death due to study cancer without documented progression, or death due to unknown causes without documented progression; distant metastasis and death due to other causes were considered competing risks. Local-regional failure time is defined as time from randomization to the date of progression/death or last known follow-up (censored). Rates are estimated by the cumulative incidence method. The protocol endpoint is the distribution of local-regional failure times, for which the hazard ratio is reported in the statistical analysis results. Five-year rate is reported simply as summary data; it is not the outcome measure., From randomization to last follow-up. Analysis was to occur after 180 deaths were reported. Analysis occurred after 133 deaths were reported. Maximum follow-up at time of analysis was 6.5 years.|Time to Distant Metastasis, Failure for distant metastasis endpoint was defined as distant progression; local-regional failure and death due to any cause were considered competing risks. Distant metastasis time is defined as time from randomization to the date of progression/death or last known follow-up (censored). Rates are estimated by the cumulative incidence method. The protocol endpoint is the distribution of distant metastasis times, for which the hazard ratio is reported in the statistical analysis results. Five-year rate is reported simply as summary data; it is not the outcome measure., From randomization to last follow-up. Analysis was to occur after 180 deaths were reported. Analysis occurred after 133 deaths were reported. Maximum follow-up at time of analysis was 6.5 years.|Time to Secondary Primary Cancer, Failure for second primary endpoint was defined as reporting of a new primary cancer; death due to any cause was considered a competing risk. Second primary time is defined as time from randomization to the date of second primary or last known follow-up (censored). Rates are estimated by the cumulative incidence method. The protocol endpoint is the distribution of second primary cancer times, for which the hazard ratio is reported in the statistical analysis results. Five-year rate is reported simply as summary data; it is not the outcome measure., From randomization to last follow-up. Analysis was to occur after 180 deaths were reported. Analysis occurred after 133 deaths were reported. Maximum follow-up at time of analysis was 6.5 years.|Distribution of First Progression Events, The first event type for progression-free survival is counted for each participant. Possible first progression events are local, regional, or distant progression, any combination of these, or death. The frequency table of these events is also referred to as "Pattern of failure.", From randomization to last follow-up. Analysis was to occur after 180 deaths were reported. Analysis occurred after 133 deaths were reported. Maximum follow-up at time of analysis was 6.5 years.|Percentage of Participants Experiencing Early Death, Early death is defined as death due to adverse event or within 30 days of treatment completion., From randomization to last follow-up. Analysis was to occur after 180 deaths were reported. Analysis occurred after 133 deaths were reported. Maximum follow-up at time of analysis was 6.5 years.|Percentage of Participants With Acute Grade 3-4 Treatment-related Adverse Events: During Treatment, Acute adverse events (AE) are defined as occurring within 180 days from the end of treatment. "Treatment-related" means reported as definitely, probably, or possibly related to protocol treatment. AE were graded using the Common Terminology Criteria for Adverse Events (CTCAE) v4.0. Grade refers to the severity of the AE. The CTCAE v4.0 assigns Grades 1 through 5 with unique clinical descriptions of severity for each AE based on this general guideline: Grade 1 Mild, Grade 2 Moderate, Grade 3 Severe, Grade 4 Life-threatening or disabling, Grade 5 Death related to AE, From start of treatment to end of treatment, approximately 6 weeks|Percentage of Participants With Acute Grade 3-4 Treatment-related Adverse Events: 1 Month After End of Study Treatment, Acute adverse events (AE) are defined as occurring within 180 days from the end of treatment. "Treatment-related" means reported as definitely, probably, or possibly related to protocol treatment. AE were graded using the Common Terminology Criteria for Adverse Events (CTCAE) v4.0. Grade refers to the severity of the AE. The CTCAE v4.0 assigns Grades 1 through 5 with unique clinical descriptions of severity for each AE based on this general guideline: Grade 1 Mild, Grade 2 Moderate, Grade 3 Severe, Grade 4 Life-threatening or disabling, Grade 5 Death related to AE, From start of treatment to approximately 2.5 months (1 month after the end of treatment)|Percentage of Participants With Acute Grade 3-4 Treatment-related Adverse Events: 3 Months After the End of Study Treatment, Acute adverse events (AE) are defined 